import React from 'react'
import styled from 'styled-components';

const StyledBurger = styled.div`
width:2rem;
height:2rem;
position:fixed;
top:15px;
right:20px;


div{
    width:2rem;
    height:0.25rem;
    background-color:black;
    
}
`

function BurgerMenu() {
    return (
        <StyledBurger>
            <div />
            <div />
            <div />



        </StyledBurger>
    )
}

export default BurgerMenu
